import React from 'react';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';

const Content = () => {
	return (
		<Container>
			<Grid container direction='row-reverse' justify='space-between' style={{ padding: '20px 0' }}>
				<Grid item>
					<h3>به تیزتایپ خوش آمدید</h3>
					<p style={{ direction: 'rtl' }}>تیزتایپ بستری برای سفارش و انجام پروژه های تایپ بصورت آنلاین می‌باشد.</p>
				</Grid>
				<Grid item>some2</Grid>
				<Grid item>some3</Grid>
			</Grid>
		</Container>
	);
};

export default Content;
